class Solution:
    def smallestTrimmedNumbers(self, nums, queries):
        ans = []
        for k, trim in queries:
            nums_copy = [num + ' ' * (len(num) - trim) for num in nums]
            sorted_nums = sorted(nums_copy)
            trimmed_nums = []
            for num in sorted_nums:
                index = num.index(' ')
                trimmed_nums.append((num[index + 1:], nums.index(num)))
            ans.append(trimmed_nums[k - 1][1])
        return ans
